import React from "react";
import { useActionState } from "react";

async function increment(previousState: number): Promise<number> {
  return previousState + 1;
}

async function decrement(previousState: number): Promise<number> {
  return previousState - 1;
}

function IncrementButton() {
  const [state, formAction] = useActionState(increment, 0);

  return (
    <form>
      <p>Counter: {state}</p>
      <button type="submit" formAction={formAction}>
        Increment
      </button>
    </form>
  );
}

function DecrementButton() {
  const [state, formAction] = useActionState(decrement, 0);

  return (
    <form>
      <p>Counter: {state}</p>
      <button type="submit" formAction={formAction}>
        Decrement
      </button>
    </form>
  );
}

export function CounterApp() {
  return (
    <div>
      <IncrementButton />
      <DecrementButton />
    </div>
  );
}
